import React from "react";
import { Container, Typography } from "@mui/material";

const TermsOfUse = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom mt={4}>
        Terms of Use
      </Typography>
      <Typography paragraph>
        By using Landora, you agree to comply with our platform rules. You are
        responsible for the accuracy of property data you submit.
      </Typography>
      <Typography paragraph>
        We reserve the right to remove properties that violate community
        standards or legal requirements.
      </Typography>
    </Container>
  );
};

export default TermsOfUse;
